import os
from selenium import webdriver
from selenium.webdriver.support.ui import WebDriverWait
from selenium.webdriver.support import expected_conditions as EC
from selenium.webdriver.common.by import By
from selenium.common.exceptions import TimeoutException
from selenium.webdriver.common.keys import Keys

URL = "https://www.google.com/imghp?sbi=1"

DUMMY = "data:image/png;base64,"

driver = webdriver.Chrome(os.getcwd() + "/chromedriver.exe")

driver.get(URL)
# driver.find_element_by_name('image_url').send_keys(DUMMY).sendKeys(Keys.RETURN)
timeout = 5  # seconds
try:
    element_present = EC.presence_of_element_located((By.NAME, 'image_url'))
    WebDriverWait(driver, timeout).until(element_present)
except TimeoutException:
    print("Loading took too much time!")

driver.execute_script(
    "document.getElementsByName('image_url')[0].setAttribute('value', '{}');".format(DUMMY))
driver.find_element_by_name('image_url').send_keys(Keys.RETURN)

assert "Python" in driver.title
elem = driver.find_element_by_name("q")
elem.clear()
elem.send_keys("pycon")
elem.send_keys(Keys.RETURN)
assert "No results found." not in driver.page_source
